import React from 'react';
import styled from 'styled-components';

const ContactContainer = styled.div`
  width: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const ContactHero = styled.div`
  width: 1552px;
  height: 257px;
  background: #004C97;
  border-radius: 6px;
  display: flex;
  justify-content: center;
  align-items: center;
  margin-top: 0;
`;

const ContactTitle = styled.h1`
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 96px;
  line-height: 150%;
  letter-spacing: -2.3%;
  color: #FFFFFF;
  text-align: center;
  margin: 0;
`;

const ContactOptionsSection = styled.div`
  width: 1552px;
  margin-top: 50px;
  display: flex;
  justify-content: space-between;
  padding: 0 64px;
  box-sizing: border-box;
`;

const ContactOption = styled.div`
  width: 237px;
  height: 195px;
  background: #FFFFFF;
  border: 2px solid #3495DB;
  border-radius: 6px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: 20px;
  box-sizing: border-box;
`;

const ContactIcon = styled.div`
  width: 60px;
  height: 60px;
  background: #3495DB;
  border-radius: 8px;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: 20px;
  font-size: 24px;
  color: white;
`;

const ContactOptionTitle = styled.h3`
  width: 217px;
  height: 195px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 24px;
  line-height: 150%;
  letter-spacing: -1.9%;
  color: #000000;
  text-align: center;
  margin: 0 0 10px 0;
`;

const ContactOptionDescription = styled.p`
  width: 292px;
  height: 60px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 400;
  font-size: 16px;
  line-height: 150%;
  letter-spacing: -1.9%;
  color: #1E1E1E;
  text-align: center;
  margin: 0;
`;

const ContactFormSection = styled.div`
  width: 1552px;
  margin-top: 80px;
  padding: 0 64px;
  box-sizing: border-box;
`;

const ContactFormTitle = styled.h2`
  width: 1548px;
  height: 662px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 48px;
  line-height: 150%;
  letter-spacing: -2.2%;
  color: #000000;
  text-align: center;
  margin-bottom: 40px;
`;

const ContactForm = styled.form`
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 20px;
`;

const FormInput = styled.input`
  width: 810px;
  height: 60px;
  background: #E6F3FF;
  border: 2px solid #3495DB;
  border-radius: 6px;
  padding: 0 20px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 400;
  font-size: 18px;
  color: #3495DB;
  box-sizing: border-box;

  &::placeholder {
    color: #3495DB;
  }

  &:focus {
    outline: none;
    border-color: #004C97;
  }
`;

const FormTextarea = styled.textarea`
  width: 1104px;
  height: 80px;
  background: #E6F3FF;
  border: 2px solid #3495DB;
  border-radius: 6px;
  padding: 20px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 400;
  font-size: 18px;
  color: #3495DB;
  resize: vertical;
  box-sizing: border-box;

  &::placeholder {
    color: #3495DB;
  }

  &:focus {
    outline: none;
    border-color: #004C97;
  }
`;

const ContactButton = styled.button`
  width: 197px;
  height: 68px;
  background: linear-gradient(90deg, #FF9E42 0%, #FFC287 100%);
  border: none;
  border-radius: 6px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 18px;
  line-height: 150%;
  letter-spacing: -1.9%;
  color: #FFFFFF;
  cursor: pointer;
  margin-top: 20px;
  transition: transform 0.2s ease;

  &:hover {
    transform: scale(1.05);
  }
`;

const Contact = () => {
  const contactOptions = [
    {
      icon: "🔧",
      title: "Report an Issue",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit."
    },
    {
      icon: "👤",
      title: "Submit Resume",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit."
    },
    {
      icon: "✉️",
      title: "Send an Email",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit."
    }
  ];

  return (
    <ContactContainer>
      <ContactHero>
        <ContactTitle>Contact</ContactTitle>
      </ContactHero>

      <ContactOptionsSection>
        {contactOptions.map((option, index) => (
          <ContactOption key={index}>
            <ContactIcon>{option.icon}</ContactIcon>
            <ContactOptionTitle>{option.title}</ContactOptionTitle>
            <ContactOptionDescription>{option.description}</ContactOptionDescription>
          </ContactOption>
        ))}
      </ContactOptionsSection>

      <ContactFormSection>
        <ContactFormTitle>Contact Us For More Questions & Concerns:</ContactFormTitle>
        <ContactForm>
          <FormInput 
            type="text" 
            placeholder="Full Name" 
          />
          <FormInput 
            type="text" 
            placeholder="Email / Phone Number" 
          />
          <FormTextarea 
            placeholder="Message"
            rows={4}
          />
          <ContactButton type="submit">Contact Us</ContactButton>
        </ContactForm>
      </ContactFormSection>
    </ContactContainer>
  );
};

export default Contact;
